replyComment:
@Nancie Drew Proof before support. Yes we should care and have compassion, and do as legally obligated , which is investigate further. The family, as this person implied, should get the alleged abuser away, or go through court if complicated. But, we should not outright support their allegations unless it's actually sustained, and not believe it unless it's actually proven to be true. 
Just like we treat alleged abusers, we need to also treat the accusers as alleged victims, who may or not be honest until something actually lines up woth their accusations. Most abuse allegations has at least one detail that lines up, although it may not make it to trial--- if someone has no actual shit it back to up they need to be treated as false accusers.

It is not justice unless both sides are treated fairly, and the same in the court of law.
